import React, { useState } from "react";
import Register from "../components/Register";
import Login from "../components/Login";
import Profile from "../components/Profile";
import Dashboard from "./Dashboard";

export default function Home() {
  const [userLoggedIn, setUserLoggedIn] = useState(false);
  const [showDashboard, setShowDashboard] = useState(false);

  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h1>Welcome to AI Enhancements</h1>

      {/* Existing AI Enhancements section */}
      <div style={{ marginBottom: "30px" }}>
        <h2>AI Enhancements</h2>
        <p>Use this platform to:</p>
        <ul>
          <li>Extract skills from resumes</li>
          <li>Get job ↔ applicant match scores</li>
          <li>Receive smart job recommendations</li>
        </ul>
      </div>

      {/* User Authentication & Profile section */}
      <div style={{ marginBottom: "30px" }}>
        <h2>User Authentication & Profile</h2>
        {!userLoggedIn ? (
          <>
            <Register onRegisterSuccess={() => alert("Registered! Please login.")} />
            <Login onLoginSuccess={() => { setUserLoggedIn(true); setShowDashboard(true); }} />
          </>
        ) : showDashboard ? (
          <Dashboard />
        ) : (
          <Profile />
        )}
      </div>
    </div>
  );
}
